script: |
  super -f text -I q4699.spq | sort > q4699.out

inputs:
  - name: q4699.spq
    data: |
      SELECT + col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 / col0 BETWEEN + + 99 AND + col1 + - col1 * + + col2;
  - name: tab2

outputs:
  - name: q4699.out
    data: |
      51
      67
      77
